	return (
		<ComponentWrapper>
			<div className="box-img-wrapper" />
		</ComponentWrapper>
	);
}
const ComponentWrapper = styled.div`
	width: 100%;
	width: 1060px;
	position: relative;
	.box-img-wrapper {
		border: 1px solid black;
		height: 28.3%;
		/* div {
			display: inline-block;
			position: absolute;
			left: 0;
			right: 0;
			width: 100%;
			height: 100%;
			border-radius: 4px;
			object-fit: cover;
		} */
	}
`;

export default SkeletonTopBanner;
